// Environment


// Components
import { ProfileImages, IntroText, Splitter, NavigationTab, ResumeBox, HardSkills, BackgroundExperience, FeaturedWork, Portafolio } from './components';





function App() {
  return (
    <div>

      <div className='wrapper'>
        <ProfileImages />
      </div>


      <IntroText />
      <Splitter />

      <NavigationTab />
      <Splitter />

      <ResumeBox />
      <Splitter />

      <HardSkills />
      <Splitter />

      <BackgroundExperience />
      <Splitter />

      <FeaturedWork />
      <Splitter />

      <Portafolio />
      <Splitter />

    </div>
  );
}

export default App;
